 import React from 'react'
 
 const Register = () => {
     const registerform=()=>{
         <form onSubmit={handleClick}>
             <input
             type='email'
             className='form-control'
             ></input>

         </form>

     }
     return (
         <>
        <div className='container'>Register</div>
        {registerform()}

         </>
     )
 }
 
 export default Register
